import React from 'react';
import { Link } from 'react-router-dom';

const Header = () => {
  return (
    <div className="header">
      <div className="wrapper">
        <div className="logo">
          <img src="/ohDog_title.png" alt="로고" />
        </div>
        <nav className="navigation">
          <ul className="nav-wrapper">
            <Link to="/board">
              <li className="nav">
                <img src="#" alt="게시판" />
              </li>
            </Link>
            <Link to="/map">
              <li className="nav">
                <img src="#" alt="지도" />
              </li>
            </Link>
          </ul>
        </nav>
      </div>
    </div>
  );
};

export default Header;
